import React from "react";
import logo from "../img/LLL logo.png";
import "./signIn.css";

const signIn = () => {
  return (
    <div id="signIn">
      <div className="backgroundSignIn">
        <img className="logo" src={logo}></img>
        <h1>SIGN IN</h1>
        <h3>to Continue to LLL</h3>
        <form className="formSignIn">
          <label className="formText space">EMAIL</label>
          <input className="formInput space" type="text" name="name" />
          <label className="formText space">PASSWORD</label>
          <input className="formInput space" type="password" name="password" />
          <button type="submit" name="signIn"></button>
          <a>forgot password?</a>
          <p></p>
        </form>
        <a>
          <button></button>
        </a>
        <p>or sign in using</p>
        <div className="mediaSignIn"></div>
      </div>
    </div>
  );
};

export default signIn;
